sentences:
  - 'By greens, we mean leafy cruciferous vegetables, including collard greens, mustard greens and arugula (Eruca sativa).'
  - Turnip greens are covered in the turnips page.
  - 'Greens are a good dietary source of vitamin C, vitamin A, vitamin K, vitamin B6, folate, calcium, manganese, and various other minerals.'
  - 'Greens have been shown to have antioxidant and anti-inflammatory properties, and to improve glucose metabolism and be cardioprotective.'
  - "Greens contain beta-carotene and other carotenoids, quercetin, isorhamnetin, ferulic acid, kaempferol, indole-3-carbinol (I3C), 3,3'-diindolylmethane (DIM) and several other isothiocyanates, sinigrin and other glucosinolate hydrolysis products, most of which have been reported to have anti-cancer properties."
  - 'Cruciferous vegetables have been shown to inhibit the growth of human pancreatic cancer cells and to reduce the risk of lung, gallbladder, bladder, prostate, ovarian and colorectal cancer.'
  - 'Components of greens have been found to down-regulate hormone receptor expression, promote apoptosis, suppress cell cycle progression and inhibit angiogenesis of human breast cancer cells.'
  - 'Consumption of brassica vegetables has been shown to reduce the estrogen metabolite 16alpha-hydroxyestrone, which is a breast cancer promoter, and to be marginally inversely associated with breast cancer risk in population studies.'
  - A Korean study found an association between kale consumption and lower incidence of breast cancer (kale is closely related to greens).
  - Greens components quercetin and I3C have been shown increase the anti-cancer effects of the chemotherapy drug Taxol (paclitaxel).
  - Collard greens and mustard greens are healthiest when prepared by steaming and not by stir-frying.
  - Non-organic greens must be washed very thoroughly to remove pesticide residue.
  - Greens can reduce the bioavailability of iodine in the diet.
  - Cruciferous vegetables contain thioglucoside compounds that can interfere with the formation of thyroid hormone.
  - _Below are links to recent studies concerning this food.
  - 'For a more complete list, including less recent studies, please click on greens._'
